'GetStartedSettings'=>'Post Affiliate Pro әдепкі теңшеліммен жұмыс істей беру жолымен жасалған .<br/>Бірақ Сіз теңшелімді тексеруіңіз керек and өз қажеттілігіңізге сәйкестендіруіңіз керек. <br/>Сіз теңшелім бейнебеткесін <strong> астында таба аласыз. Теңш & Құралдар мәзірі -> Теңшелім</strong>.<br/><br/>Барлық теңшелім опцияларының толығырақ сипаттамасы қолданушының бағыттауышынан немесе білімқорынан табылады.',
'Define your commissions'=>'Комиссияларыңызды таңдаңыз',
'GetStartedCommissions'=>'Орнату кезінде бір әдепкі науқан жасалды. Сіз оны өзгерте аласыз немесе өз комиссияңызды жасай аласыз.<br/><br/> Науқандар бір комиссия параметрлеріне ие өнімдер жиынын топтау үшін қолданылады. (немес бір ғана өнім).<br/><br/> Мысалы, Сізде Өнім1 үшін науқан болуы мүмкін, мұнда Сіз өз қосуыңызды нұқу арқылы марапаттай аласыз, және екінші науқан Өнім2 үшін, мұнда қосу комиссияны сату арқылы қайтара алады.<br/><br/> Немесе Сізде Төмен шығын өнімдері деп аталатын науқан болады, ол сату комиссиясының 40% пайызын құрайды, ал екінші науқан Қымбат өнімдер деп аталады, ол сату комиссиясының 15% пайызын құрайды.',
'Add banners and other creatives'=>'Жарламаларды немесе басқа жасамдарды қосу.',
'GetStartedCreatives'=>'<strong>реттеуші жарламаларында</strong> Сіз мәтін сілтемелерінен жасамдарды,HTML-ге стандартты кескін жарламаларын, флэш және доңғалақтық электрондық пошта жарламаларды өзгерте аласыз. In the <strong>Banners manager</strong> you can various creatives, from text links, standard image banners to HTML, Flash and promo email banners.<br/> Әр жарламаның арнайы URL тағайындауы болуы керек - бұл URL-де шерткеннен кейін келуші қайта бағытталады."',
'Set up emails'=>'Электрондық пошталарды белгілеу',
'GetStartedEmails'=>'Сіз электрондық пошта функционалдығын орнатуыңыз керек. Бұл: <ul><li><strong>пошта есебі</strong> - электрондық поштаның қалай жіберілетінін қамтиды. Сіз пошта () атқарымын да, SMTP серверін де таңдай алмайсыз. </li><li><strong>пошта үлгілері</strong> – бұлар жүйе автоматты электрондық пошта жібергенде қолданылатын үлгілер </li><li><strong>электрондық пошта ескертпелері</strong> – сіз қалаған ескертпені теңшей аласыз.</li></ul>Пошта есебінің дұрыс орнатылғанына көз жеткізіңіз – жіберілген электрондық пошталарды сынақтан өткізуге тырысыңыз. Жұмыс істейтін электрондық поштасыз қосулар олардың белгіленуі туралы бекітуді қайтармайды, т.с.с..',
'Customize your affiliate signup form'=>'Өз қосу белгілеу пішінін теңшеңіз.',
'GetStartedSignupForm'=>'Стандартты белгілеу пішінін тексеріңіз және қаласаңыз, оларды теңшеңіз.<br/><br/> Белгілеу пішіні шағын-торап мәліметімен бірге келеді - ол қосу бағдарламалары туралы мәліметті қамтиды, т.б.<br/>Сіз шағын-торапты қолдана аласыз немесе оны жойып, тек белгілеу пішінін қолдана аласыз.',
'Customize affiliate panel'=>'Қосу тақтасын теңшеу',
'GetStartedAffPanel'=>'Post Affiliate Pro-тегі Қосу тақтасы  өте икемді. <br/>Сіз мәзірді теңшей аласыз, онда қандай мазмұн болу керектігін жасайсыз және, тіпті, өз мазмұныңызды жаза аласыз немесе басқа беттерге сілтеме орната аласыз.',
'GetStartedIntegrate'=>'Біріктіру дегеніміз - қосу жүйесін Сіздің ағымдағы веб-торапқа, сатып алу карточкасы немесе төлем шлюздерін қосу жүйесі ұсынымдар мен сатып алу туралы ескертілетін жолмен қосу жолы.<br/> Ескертілген жағдайда қосу жүйесі сатуды тіркейді, сілтенген қосуды (егер бар болса) табады және сәйкес комиссияны жасайды.<br/><br/> Біріктіру әдетте Сіздің беттеріңізге бірнеше код сызықтарын қосуды білдіреді, және ол Біріктіру бағыттағышында сатылай сипатталады.',
'Test everything'=>'Бәрін сынақтан өткізу',
'GetStartedTest'=>'Өз науқандарыңызды теңшегенде, дұрыс комиссияны анықтағанда және бірнеше жарламаларды/сілтемелерді жасағанда, жүйені сынақтан өткізуіңіз керек.<br/> Ең дұрысы қосудан толық өңдеуді және өз көзқарасыңызды модельдеу: <ol> <li>Бірнеше сынақтан өткізуші қосу ретінде белгілеу – бекіткен соң Сізге құпия сөзіңізбен бірге электрондық поштаны алғандықты растау хаты келеді, және Сізге өз қосу тақтаңызға жүйеге кіруге мүмкіндік беріледі</li> <li>Қосу тақтасына жүйеге кіру, жарламалар/сілтемелер үшін код алу және оларды сынақтан өткізу бетіне орналастыру</li> <li>Жарламаға нұқыңыз және шертпенің тіркелгендігін тексеріңіз</li> <li>Шерткен соң сату сынағын жасауға тырысыңыз және сату комиссиясының қосу жүйесінде тіркелгенін тексеріңіз<li> </ol> Егер Сіз ос ысатының қай-қайсысында болсын бірнеше мәселені әрекеттендірсеңіз, мынаған қосылыңыз: <strong>оқиға тіркеу күйін келтіру </strong> және қараңыз <strong>Troubleshooting</strong>',
